import Home from "../component/home";
import News from "../component/news";
import User from "../component/user";
import Not404 from "../component/not404";

const routers = [
    {
        exact:true,
        path:'/',
        component:Home
    },
    {
        path:'/news',
        component:News
    },
    {
        path:'/user',
        component:User
    },
    {
        // path:'*',
        component:Not404
    }
];
export default routers;
